\u5982\u679C\u5728\u7FA4\u804A\u5185\u8FDD\u89C4(\u89C1\u9644\u5F55\u7EC6\u5219), \u89C6\u60C5\u51B5\u6709\u4EE5\u4E0B\u5904\u7F5A\uFF1A
1, \u5220\u9664\u8A00\u8BBA: \u8FDD\u89C4\u53CA\u4E0D\u9002\u5408\u7684\u5E16\u5B50\u6216\u8005\u8BC4\u8BBA\u5C06\u88AB\u5220\u9664
2, \u7981\u8A00\u7528\u6237\uFF1A\u5728\u7528\u6237\u540D\u88AB\u5C01\u671F\u95F4, \u4E0D\u80FD\u4EE5\u8BE5\u7528\u6237\u540D\u53D1\u5E16\u4EE5\u53CA\u53D1\u8868\u8BC4\u8BBA\uFF0C\u7981\u8A00\u5305\u542B\u6682\u65F6\u548C\u6C38\u4E45\u3002
