4, \u7FA4\u7981\u8A00\uFF1A\u5168\u4F53\u6210\u5458\u5747\u4E0D\u80FD\u53D1\u8A00\u3002
5, \u79FB\u9664\u7FA4\u804A\uFF1A\u4ECE\u5F53\u524D\u7FA4\u804A\u4E2D\u8E22\u51FA\u3002
6,  \u6C38\u4E45\u5C01\u53F7\uFF1A\u6C38\u4E45\u4E0D\u80FD\u767B\u5F55\u548C\u53C2\u4E0E\u7FA4\u804A\u3002

